import React from 'react'
import styled from 'styled-components';

const Styles = styled.div`
	.nav {
		background-color: black;
		color: white;
		width: 100%;
		height: 10%;
		position: fixed;
		top: 0;
		left: 0;
	}
`;

export default class NavigationBar extends React.Component {
	render() {
		return(
			<Styles>
			<div className='nav'>
				<h1>hey</h1>
			</div>
			</Styles>
		)
	}
}
